import React from "react";
import circleImage from "./img/imagecircle.png"

function About(){
    return (
        <div className=" h-screen bg-opacity-5 bg-teal-500 p-5 flex">
            <div className="px-15percent mx-auto mt-10">
                <h3 className=" text-center text-3xl font-bold text-teal-500">Biodata</h3>
                <img className=" my-5 w-44 " src={circleImage} alt="circlephoto"/>
                <p className="font-semibold">Hi, my title is Muzamil Haq, and I'm 27 years old. I'm very interested in technology, especially programming, and I previously studied at the Putra Indonesia University. Since graduating from college, I've assisted several people who require my programming skills, such as the Padang Religious Court in Indonesia, where I created native android applications for asset management. I can also create augmented reality applications and perform website enhancements, such as landing pages and API servers.</p>
            </div>
        </div>
    );
}

export default About;
